import React from 'react';
import './comp1.css';

const Component1 = (props) => {
  const { changeId } = props;

  const changeComponent = (e) => {
    e.preventDefault();
    const form = e.target;
    if (form.checkValidity()) {
      changeId(2);
    } else {
      form.reportValidity();
    }
  };

  return (
    <form className="component1">
      <h2>Create a project</h2>
      <br />
      <label>
        <h3>Name</h3>
        <input className="input-box" type="text" required />
      </label>

      <label>
        <h3>Type</h3>
        <select className="select-box" required>
        <option value="" disabled selected hidden>
          Select your role
        </option>
          <option value="#F00">Red</option>
          <option value="#0F0">Green</option>
          <option value="#00F">Blue</option>
        </select>
      </label>

      <label>
        <h3>Select Your Role</h3>
        <select className="select-box" required>
          <option value="" disabled hidden>
            Select your role
          </option>
          <option value="BAP">BAP</option>
          <option value="BPP">BPP</option>
          <option value="Beckn Gateway">Beckn Gateway</option>
          <option value="Beckn Registry">Beckn Registry</option>
        </select>
      </label>

      <button className="save-button" onClick={changeComponent}>
        Save and Proceed
      </button>
    </form>
  );
};

export default Component1;
